import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Calculator from './Calculator';
//import ScientificCalculator from './ScientificCalculator';
import MeasurementConversion from './MeasurementConversion';
import MoneyConversion from './MoneyConversion';
import Feedback from '../src/components/Feedbaackform';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Calculator />} />

                <Route path="/measurement-conversion" element={<MeasurementConversion />} />
                <Route path="/money-conversion" element={<MoneyConversion />} />
                <Route path="/feedback" element={<Feedback />} />
            </Routes>
        </Router>
    );
};

export default App;
